import React,{Component} from "react";
import "../../scss/components/__sendmail.scss";

class Send extends Component {
  
    render(){
      
        return(
          
                <div className="sendmail_wrapper">
                    <div>
                        <form>
                            <label>From</label>
                        </form>
                    </div>
                </div>
        )
    }

};

export default Send;
